import { requestRegisterUserValentano } from "../../anstanceUrl/request"
import { axiosInstance } from "../../anstanceUrl/urlInstance"



export const AllFunction = {
    register: (data) => {

        return axiosInstance({
            url: requestRegisterUserValentano.registerUserValentano,
            method: 'post',
            credentials: 'include',
            body: data
        }).then((res) => {
            return res
        }).catch((err) => {
            return err
        })
    },

    login: (data) => {
        console.log(data)
        return axiosInstance({
            url: requestRegisterUserValentano.loginUserValentano,
            method: 'post',
            credentials: 'include',
             data
        }).then((res) => {
            console.log(res)
            return res
        }).catch((err) => {
            return err
        })
    },

    ///////////////this function for ragazzo

    loginRagazzo:(data)=>{
        return axiosInstance({
            url:codefischale
        })
    }
}
